measurements.description:
One flower and two buds on a 16.0-cm slightly arching inflorescence;
	dorsal sepal green, veined cordovan, wide white margin; 
	synsepal pale green, veined darker green; 
	petals hirsute, twisted, slightly reflexed, pale green spotted oxblood; 
	pouch pale green, overlaid rose, stippled darker rose; staminode largely green, centrally lighter, margin velvet, tinted cordovan; 
	substance firm; texture waxy.
